            <style>
              svg#freepik_stories-pharmacist:not(.animated) .animable {
                opacity: 0;
              }

              svg#freepik_stories-pharmacist.animated #freepik--Shelf--inject-3 {
                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideLeft;
                animation-delay: 0s;
              }

              svg#freepik_stories-pharmacist.animated #freepik--Counter--inject-3 {
                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideUp;
                animation-delay: 0s;
              }

              svg#freepik_stories-pharmacist.animated #freepik--Plant--inject-3 {
                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) fadeIn;
                animation-delay: 0s;
              }

              svg#freepik_stories-pharmacist.animated #freepik--Character--inject-3 {
                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideLeft;
                animation-delay: 0s;
              }

              @keyframes slideLeft {
                0% {
                  opacity: 0;
                  transform: translateX(-30px);
                }

                100% {
                  opacity: 1;
                  transform: translateX(0);
                }
              }

              @keyframes slideUp {
                0% {
                  opacity: 0;
                  transform: translateY(30px);
                }

                100% {
                  opacity: 1;
                  transform: inherit;
                }
              }

              @keyframes fadeIn {
                0% {
                  opacity: 0;
                }

                100% {
                  opacity: 1;
                }
              }
